<SUMMARY>
A linear utility model combining base preference, environmental influence, and stochastic noise. The model uses two learnable parameters: a base tendency parameter (β) constrained to [0,1] and an unconstrained environmental sensitivity parameter (ε). Environmental cues and normally distributed noise modify the base utility, allowing for both systematic and random variation in choice behavior.
</SUMMARY>
</EXAMPLE>

Please be sure to provide the mathematical formula for the model between <MODEL> and </MODEL>, and the variable descriptions between <VARIABLES> and </VARIABLES>. No description of the model should be provided within the <MODEL> tags.

The parameter names you choose in your <VARIABLES> section will be used exactly as specified in subsequent code generation. Please choose clear, non-reserved parameter names that can be used directly in Python code. For example, avoid Python reserved words like 'lambda' and use alternatives like 'learning_rate' or 'lambda_param'.

You will be given the complete list of models that you have already created. Analyze the models, and notice the absence of possible explanations of behaviors that should be tested. You should start with simple obvious explanations, and as you notice these being thoroughly explored you should shift to fundamentally different models of behavior. Pay less attention to the names of the variables, and how they are actually interacting with the given behavioral data.

Your results will be scored on a combination of BIC with a penalization for number of learned parameters, the ability to recover those learned parameters, and the ability of those parameters to account for the differences in behaviors among varying groups of people.

Previous Models:
Model 1:
Specification: U_i = gamma * split_self - alpha * max( (combined_earning * (token_self / (token_self + token_opp))) - split_self , 0 )
Summary: This model computes the utility for a responder’s acceptance decision by combining the monetary gain (split_self) with a fairness penalty based on the difference between an expected fair share (derived from token_self, token_opp, and combined_earning) and the actual offer. Two learnable parameters, gamma and alpha, capture sensitivity to monetary reward and aversion to disadvantageous inequality respectively.
Model 2:
Specification: U_accept = split_self - theta * ( max( combined_earning * ( token_self / ( token_self + token_opp ) ) - split_self , 0 ) )^(kappa)
Summary: A utility model for responder behavior that computes the acceptance utility as the offered share minus a non-linear penalty for offers that fall below the fairness norm. The fairness norm is determined by the proportion of tokens obtained relative to the total tokens. Two learnable parameters—theta and kappa—control the sensitivity and non-linearity of the penalty.

full_reasoning:
Step-by-step reasoning:
1. Responders typically care about the direct monetary gain (the offer in split_self) but also compare that gain against a fairness expectation. In this task, the fairness expectation can be computed from the tokens gathered by the participant relative to the total tokens (token_self/(token_self+token_opp)), scaled by the total money available (combined_earning).
2. Psychological principles such as inequity aversion and reference-dependent preferences suggest that responders experience a penalty if the offer deviates substantially from what they view as “fair.” Unlike past models that only penalized disadvantageous inequality, here we penalize deviations from fairness in a smooth (quadratic) fashion. This captures that both an offer that is too low and—if one experienced guilt—a surprisingly generous offer might be evaluated against a personal fairness reference.
3. Mathematically, we model the utility for accepting an offer (U_accept) as a weighted benefit from the monetary gain minus a quadratic penalty representing the squared deviation from one’s fairness expectation.
4. We introduce two learnable parameters:
   • A scaling parameter (lambda_param) for the monetary gain.
   • A fairness sensitivity parameter (beta) that determines the strength of the quadratic penalty for deviations from fairness.
5. All variables used (split_self, combined_earning, token_self, token_opp) are contained in the dataset. The fairness norm is computed specifically as the product of combined_earning and the ratio token_self/(token_self + token_opp).

Below is the formal specification.

<MODEL>
U_accept = lambda_param * split_self - beta * (split_self - combined_earning * (token_self / (token_self + token_opp)))^2
</MODEL>

<VARIABLES>
