<SUMMARY>
A reference-dependent utility model for respondent behavior where the utility of accepting an offer is determined by a weighted monetary gain minus a quadratic penalty for deviation from the fairness norm. The fairness norm is computed as the expected fair share based on tokens contributed. This model employs two learnable parameters: lambda_param scales the gain and beta governs fairness sensitivity.
</SUMMARY>
